import React from "react";
import './Main.css';

const Main = () => {
    return (
        <>
            <div className="heading-text">
                <h1>Upload an Image to check whether you have Melanoma or not for <span >free!</span></h1>
            </div>
            <div className="upload-section">
                <h1>Home</h1>
            </div>
        </>
    )
}

export default Main;
